import React from 'react';


function Monroe() {
    return (
        <div>
            <h1>Your style icon match is Marilyn Monroe! </h1>
            <img className='resultImg' alt="" src="https://pixel.nymag.com/imgs/thecut/slideshows/2017/10/Marilyn-Monroe/Marilyn-Monroe-11.w1200.h630.jpg" />
            <h3 className='resultDescr'>You gravitate toward a higher end classic style. You take great care in your appearance and its up-keep.</h3>
        </div>
    );
};



export default Monroe;
